    "2015-07-23T03:28:38.029059",nt"name": "annual-refuge-narrative-report-carolina-sandhills-national-wildlife-refuge-january-decemb--68af2",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Carolina Sandhills
    National Wildlife Refuge summarizes refuge activities from January through December
    1967. The report begins with a summary of weather and habitat conditions during
    the period. Wildlife including migratory birds, upland game birds, big game animals,
    fish, and furbearers is also covered. A refuge development and maintenance section
    covers physical development, farming activities, and fires. A resource management
    section discusses grazing, fur harvest, and forestry. A public relations section
    outlines recreational use, refuge visitation, and safety. Items of interest are
    provided at the end of the report.",nt"license_title": "License Not Specified",nt"extras":
